    return(
        <ul>
            {vsn.map((post)=>(
                <li>{post.title}</li>
            ))}
        </ul>
    )
}

export async function getStaticProps(){
    const res=await fetch("http://.../posts")
    const vsn=await res.json()
    if(!vsn){
        return{
            notFound:true,
        }
    }
    return{
        props:{
            vsn,
        },
    }
}
export default test3
